import { SaveOutlined } from "@mui/icons-material";
import { Box, Button, TextField, Typography } from "@mui/material";
import React from "react";

const CreateContact = () => {
  return (
    <Box
      sx={{
        width: "100%",
        height: "90vh",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        alignContent: "center",
        border: 1,
        borderColor: "lightgrey",
        overflowX: "hidden",
      }}
    >
      <Box
        sx={{
          width: "70%",
          height: "80vh",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          alignContent: "center",
          border: 1,
          borderColor: "lightgrey",
        }}
      >
        <Box component={"form"} sx={{ width: "80%" }}>
          <Box
            sx={{
              display: "flex",
              direction: "row",
            }}
          >
            <TextField
              name="firstName"
              label={"FirstName"}
              variant={"outlined"}
              sx={{ width: "100%", mt : 2, height : '40px' }}
              type={'text'}
            />
            <TextField
              name="lastName"
              label={"LastName"}
              variant={"outlined"}
              sx={{ width: "100%", height : '40px' }}
              type={'text'}
            />
          </Box>

          <TextField
              name="email"
              label={"Email"}
              variant={"outlined"}
              sx={{ width: "100%", mt : 2, height : '40px' }}
              type={'email'}
            />

            <Button type="submit" variant="outlined" endIcon={<SaveOutlined />} sx={{width : '100%', mt : 2}}>
                <Typography align="center">Save</Typography>
            </Button>

        </Box>
      </Box>
    </Box>
  );
};

export default CreateContact;
